import React from 'react'
import { SingleCard } from '../styles/Cards'

function Card({card}) {
    return (
        <SingleCard key={card.id}>
            <div>
                <img src={card.src} alt="card back" className="front" />
                <img src="/img/cover.png" alt="card back" className="back" />
            </div>
        </SingleCard>
    )
}

export default Card
